import React from 'react';
import DummyData from '../DummyData';

const SignatureDish:React.FC<{name:string, image:string, signature:string, description:string, icon:string, price:number}> = (props) => {
  return (
    <div className="popular-item">
      <img src={props.image} alt="popular-img"></img>
      <h2>{props.name}</h2>
      <p>{props.signature}</p>
      <p>{props.description}</p>
      <p>{props.icon}</p>
      <p>{props.price}</p>
    </div>
  )
}

export default SignatureDish;
